INSERT INTO knowledge_unit(knowledge_area_id,id,name,definition) VALUES (100,1002,'Data Integrity and Authentication','Authentication is considered as a subdomain of security, since in the same way as security, authentication depends largely on important aspects of confidentiality, integrity and availability, which are considered as mandatory requirements for the design of systems insurance. ');
INSERT INTO knowledge_unit(knowledge_area_id,id,name,definition) VALUES (100,1003,'Access Control','Access control refers to the process of managing the request to resources and data maintained by a system in order to determine whether the request should be accepted or denied. According to the complexity of the protection requirements that a system has, access control will be far from being a trivial process. ');
