INSERT INTO knowledge_unit(knowledge_area_id,id,name,definition) VALUES (100,1005,'Cryptoanalisis','It means trying to break any security (or encryption) system using unauthorized ways to access the information on that system. Thus, cryptanalysis works against cryptography. The cryptanalyst tries to find any weaknesses in the cryptographic system to obtain the source of information (plain text) or the key used in the encryption algorithm. ');
