INSERT INTO WORK_ROLE (id, Name, Description) VALUES (9100,'Authorizing Official/Designating Representative', 'Senior official or executive with the authority to formally assume responsibility for operating an information system at an acceptable level of risk to organizational operations (including mission, functions, image, or reputation), organizational assets, individuals, other organizations, and the Nation (CNSSI 4009).');
INSERT INTO WORK_ROLE (id, Name, Description) VALUES (9101,'Security Control Assessor', 'Conducts independent comprehensive assessments of the management, operational, and technical security controls and control enhancements employed within or inherited by an information technology (IT) system to determine the overall effectiveness of the controls (as defined in NIST SP 800-37).');
INSERT INTO WORK_ROLE (id, Name, Description) VALUES (9102, 'Software Developer', 'Develops, creates, maintains, and writes/codes new (or modifies existing) computer applications, software, or specialized utility programs.');
INSERT INTO WORK_ROLE (id, Name, Description) VALUES (9103, 'Secure Software Assessor', 'Analyzes the security of new or existing computer applications, software, or specialized utility programs and provides actionable results.');
INSERT INTO KSAT(ID,Type,Description) VALUES (30001,'Task','Acquire and manage the necessary resources, including leadership support, financial resources, and key security personnel, to support information technology (IT) security goals and objectives and reduce overall organizational risk.');
INSERT INTO KSAT(ID,Type,Description) VALUES (30002,'Task','Acquire necessary resources, including financial resources, to conduct an effective enterprise continuity of operations program.');
