INSERT INTO KSAT(ID,Type,Description) VALUES (80141,'Abilities','Ability to work closely with authorizing officials and their designated representatives to help ensure that an organization-wide security program is effectively implemented resulting in adequate security for all organizational systems and environments of operation.');
INSERT INTO KSAT(ID,Type,Description) VALUES (80142,'Abilities','Ability to work closely with authorizing officials and their designated representatives to help ensure that security considerations are integrated into programming/planning/budgeting cycles, enterprise architectures, and acquisition/system development life cycles.');
INSERT INTO KSAT(ID,Type,Description) VALUES (80143,'Abilities','Ability to work closely with authorizing officials and their designated representatives to help ensure that organizational systems and common controls are covered by approved security plans and possess current authorizations.');
INSERT INTO KSAT(ID,Type,Description) VALUES (80144,'Abilities','Ability to work closely with authorizing officials and their designated representatives to help ensure that security-related activities required across the organization are accomplished in an efficient, cost-effective, and timely manner.');
INSERT INTO KSAT(ID,Type,Description) VALUES (80145,'Abilities','Ability to work closely with authorizing officials and their designated representatives to help ensure that there is centralized reporting of security-related activities.');
INSERT INTO KSAT(ID,Type,Description) VALUES (80146,'Abilities','Ability to establish the rules for appropriate use and protection of the information and retains that responsibility even when the information is shared with or provided to other organizations.');
INSERT INTO KSAT(ID,Type,Description) VALUES (80147,'Abilities','Ability to approve security plans, memorandums of agreement or understanding, plans of action and milestones, and determine whether significant changes in the systems or environments of operation require reauthorization.');
